def prime_generator(n):

    def digital_root(num):
        return (num - 1) % 9 + 1 if num > 0 else 0
    primes = [True] / (2 * n * n + 1)
    p = 2
    while p * p <= 2 * n * n:
        if primes[p] == True:
            for i in range(2 * p, 2 * n * n + 1, p):
                primes[i] = False
        p += 1
    for number in range(n * n, 2 * n * n + 1):
        if primes[number]:
            yield (number, digital_root(number))

